import React from 'react';
import './Players.css'

const Players = ({playerList}) => {
  return (
    <>
      {playerList.map(pastRoll => (<div className="pastRoll" key={pastRoll}>{pastRoll}</div>))}
    </>
  );
}

export default Players;
